import React from 'react';
import FloatInput from './FloatInput';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid'; import Stack from '@mui/material/Stack';
import { styled } from '@mui/material/styles';
import TextField from '@mui/material/TextField';


const Header = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    textAlign: 'center',
    color: theme.palette.text.secondary,
}));

function Field(props) {
    return (
        <TextField
            value={props.val}
            type="number"
            onChange={(ev) => props.handleChange(parseFloat(ev.target.value))}
        />
    )
}
export default function Vector3Input(props) {
    return (
        <>
            <Box sx={{ flexGrow: 1 }}>
                <Grid container spacing={0} columns={{ xs: 4, sm: 8, md: 12 }}>
                    <Grid item xs={2} sm={4} md={4} key={1}><Header>x</Header></Grid>
                    <Grid item xs={2} sm={4} md={4} key={2}><Header>y</Header></Grid>
                    <Grid item xs={2} sm={4} md={4} key={3}><Header>z</Header></Grid>

                    <Grid item xs={2} sm={4} md={4} key={4}>
                        <Field val={0}/>
                    </Grid>
                    <Grid item xs={2} sm={4} md={4} key={5}><Field val={0}/></Grid>
                    <Grid item xs={2} sm={4} md={4} key={6}><Field val={0}/></Grid>

                </Grid>
            </Box>
            <Stack direction="row" spacing={0}>
                <Header>x</Header>
                <Header>y</Header>
                <Header>z</Header>
            </Stack>
            <Stack direction="row" spacing={0}>
                <FloatInput val={0} label="x" />
                <FloatInput val={0} label="y" />
                <FloatInput val={0} label="z" />
            </Stack>
        </>
    );
}
